Registered users can charge their electric vehicles with Alexela's charging app in Alexela charging stations all over Estonia and if desired throughout Europe. When driving an electric car to a neighboring country or renting an electric car in any European country, the user can conveniently charge the electric car with Alexela's charging app, having access to as many as 200 000 charging stations across Europe.

Alexela's charging app allows you to:
• register conveniently and quickly as a customer of the charging service;
• search for a suitable charger and see if it is currently free or in use;
• navigate to the selected charger;
• start and stop charging the electric car;
• pay for the charge with a bank card saved in the app or for example with a PayPal account;
• find information about the charging station (charger capacity, tariffs, information about plugs, charger occupancy history during the day);
• filter and display chargers on the map according to your criteria;
• save your favorite chargers to your favorites list;
• view your charging history and costs.

– Информирует о тестовых камерах(полупрозрачная иконка). Отключаются в настройках;
– Позволяет индивидуально для города и трассы настроить сигналы, голосовые подсказки, уведомления о приближении, превышении скорости, во время нахождения и после проезда зоны действия камеры;
– Присылает текстовые уведомления с указанием максимально допустимой скорости;
– Показывает превышение скорости и расстояние к ближайшей камере;
– Учитывает сезонные ограничения скорости и позволяет их применять в автоматическом режиме;
– В режиме спидометра отображает ближайшую по курсу камеру и может работать как проектор на лобовое стекло;
– Отключается в один клик для экономии батареи.

Внимание!

Для корректной работы звуковых уведомлений – в телефоне должна быть установлена соответствующая громкость, позволяющая их услышать.

Также, чтобы вовремя предупреждать о камерах – приложению необходимо разрешить доступ к точной геопозиции в фоновом режиме(Настройки –>  Конфиденциальность –> Службы геолокации –> SpeedUp: Разрешать всегда + включить точную геопозицию). Приложение SpeedUp не сохраняет на устройстве или удалённо никакой информации о геопозиции устройства от слова совсем.

The application allows you to view the public cadastral map of Ukraine and provides additional features:
- search for a land plot by cadastral number using StateGeoCadastre data, all successful search results are stored in history on a mobile device;
- visually locate the land on the cadastral map and get click information on the cadastral number, land area, type of property and purpose. When completing additional authorization on the website of the State Geo Cadastre of Ukraine with the help of an electronic signature, obtain information on ownership and property rights;
- determine the location of the land plot on the ground and get the coordinates of the selected points; for this, you need to press a finger on the border of the land plot displayed on the StateGeoCadastre;
- create lists of selected cadastral numbers for quick search on the cadastral map;
- send information received from State Geo Cadastre of Ukraine about the cadastral number using instant messengers;
- pave the way to the land and enable navigation to quickly find it;
- to take measurements of the area by forming a polygon indicating points on the cadastral map or by recording the track when going around the land along the contour;
- receive StateGeoCadastre news online to keep abreast of all land laws;
- view the cadastral division in orthophotomaps of the Public Cadastral Map of Ukraine.

The application connects to the cloud service www.soft.farm, registered users receive additional functions for managing the land bank:
- сompare the boundaries of the units with the cultivated field;
- control lease agreements and their duration;
- receive information about shareholders and tenants.
